import React from 'react'

class Columns extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      'showLoading': true,
      'showError': false
    }
    this.elements = []
  }
  componentDidMount () {
    fetch(`http://46.188.118.134:8082/navigations?type=${this.props.type}`)

      .then(response => response.json())
      .then(response => {
        response
          .sort((a, b) => a.createdAt < b.createdAt ? 1 : -1)
          .forEach(article => {
            console.log(article)
            this.elements.push(
              <div className='column is-1'>
                <div class='container'>
                  <div class='columns'>
                    <div class='column is-offset-1'>
                      <ul>
                        <li><a href='#'>{article.name_ru}</a></li>
                      </ul>
                    </div>
                  </div>
                </div>
              </div>
            )
          })
        this.setState({
          'showLoading': false,
          'showError': false
        })
      })
      .catch(error => {
        console.error(error)
        this.setState({
          'showLoading': false,
          'showError': true
        })
      })
  }
  render () {
    return (
      <footer class='columns footer'>
        {this.elements}
      </footer>
    )
  }
}
export default Columns
